The second season of the HBO television series Boardwalk Empire premiered on September 25, 2011 and concluded on December 11, 2011. The series was created by Terence Winter and based on the book Boardwalk Empire: The Birth, High Times and Corruption of Atlantic City by Nelson Johnson. Set in Atlantic City, New Jersey, during the Prohibition era, the series stars Steve Buscemi as Enoch \\\\\\\&quot;Nucky\\\\\\\&quot; Thompson (based on the historical Enoch L. Johnson), a political figure who rose to prominence and controlled Atlantic City, New Jersey, during the Prohibition period of the 1920s and 1930s.


